import './card.styles.css';

const Card = ({ monster: { id, name, email } }) => (
	<div className='card-container'>
		<img alt={`monster ${name}`} src={ `https://robohash.org/${id}?set=set2&size=180x180` } />
		<h1>{name}</h1>
		<p>{email}</p>
	</div>
);		

export default Card;
